// ANNOUNCEMENT BAR
if ($(".announcement-bar").length) {
  const swiper = new Swiper('.announcement-bar .swiper', {
      slidesPerView: 1,      
      loop: true,
      effect: 'fade',
      fadeEffect: {
        crossFade: true
      },
      speed: 900,
      autoplay: {
          delay: 3000,
          disableOnInteraction: false,
          pauseOnMouseEnter: false,
      },
      centeredSlides: true
  })
}